    "biological-chemical-and-other-data-collected-aboard-the-thomas-g-thompson-during-cruise-tn263-i",nt"isopen":
    false,nt"url": null,nt"notes": "NODC accession 0117409 includes biological,
    chemical, optical and physical data collected aboard the THOMAS G. THOMPSON during
    cruise TN263 in the Coastal Waters of SE Alaska, Gulf of Alaska and North Pacific
    Ocean from 2011-04-30 to 2011-05-21. These data include Attenuation/Transmission,
    CONDUCTIVITY, DEPTH - BOTTOM, DEPTH - OBSERVATION, DISSOLVED OXYGEN, FLUORESCENCE,
    HYDROSTATIC PRESSURE, SALINITY and WATER TEMPERATURE. The instruments used to collect
    these data include CTD, echo sounder, fluorometer, oxygen meter and transmissometer.
    These data were collected by Nancy Kachel of US DOC; NOAA; OAR; Pacific Marine Environmental
    Laboratory, and by University of Washington as part of Ecosystem and Fisheries-Oceanography
    Coordinated Investigations (Eco-FOCI). The Lamont-Doherty Earth Observatory (LDEO)
    submitted these data to NODC as part of the NSF sponsored Rolling Deck to Repository
    (R2R) program. The CTD data submitted by the originator represent the raw data suite.
    Processed versions of the data were generated by NODC.",nt"license_title":
